int update_score(struct student *p,int n,int num,int course,int score){
    for(int i=0;i<n;i++){
        if(p[i].num == num){
            switch(course){
                case 1:
                    p[i].math = score;
                    break;
                case 2:
                    p[i].english = score;
                    break;
                case 3:
                    p[i].computer = score;
                    break;
                default:break;
            }
            return i;
        }
    }
    return -1;
}

